import React from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Topbar from "./Topbar";

function App() {
  return (
    <div className="App">
      <Topbar />
      <Jumbotron fluid>
        <Container>
          <h1>Fluid jumbotron</h1>
          <p>
            This is a modified jumbotron that occupies the entire horizontal
            space of its parent.
          </p>
        </Container>
      </Jumbotron>
    </div>
  );
}

export default App;
